import { API_SUBMIT } from '../constants/actionTypes';

const  apiStructure = (apiStructureList = [], action) => {
  switch (action.type) {
    case API_SUBMIT:
      return [...apiStructureList, action.payload];
    default:
      return apiStructureList;
  }
};

export default apiStructure;
